import React from 'react';

const Layout = ({ children, activeTab }) => (
  <div>
    {/* Simple Layout Placeholder */}
    <nav style={{ padding: '1rem', background: '#e0f2f1' }}>
      <span style={{ fontWeight: 'bold' }}>EcoCollect</span>
      <span style={{ marginLeft: '2rem' }}>Active Tab: {activeTab}</span>
    </nav>
    <main style={{ padding: '2rem' }}>{children}</main>
  </div>
);

export default Layout;
